import React,{Component,Fragment} from "react";
import "../App.css";
import LoginPage from "./LoginPage";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
  render(){
    return (
    <Router>
      <div className="wrapper">
        <Route exact path="/">
          <LoginPage/>
        </Route>
        
      </div>
      </Router>
  );
  }
}

export default App;
